// SPDX-License-Identifier: GPL

pragma solidity 0.8.0;

import "@openzeppelin/contracts-upgradeable/utils/cryptography/ECDSAUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/utils/cryptography/draft-EIP712Upgradeable.sol";

contract Test is EIP712Upgradeable {
  address admin;
  function initialize(string memory name, string memory version) public initializer {
    EIP712Upgradeable.__EIP712_init(name, version);
    admin = msg.sender;
  }

  function validateSeed(
    string memory _seed,
    bytes memory _signature
  ) public view returns (address) {
    bytes32 hash = _hashTypedDataV4(keccak256(abi.encode(
        keccak256("UpgradeItem(address user,string seed,uint256 nonce)"),
        msg.sender,
        keccak256(bytes(_seed)),
        0
      )));
    address signer = ECDSAUpgradeable.recover(hash, _signature);
    require(signer == admin, "MessageVerifier: invalid signature");
    require(signer != address(0), "ECDSAUpgradeable: invalid signature");
    return signer;
  }

  function _validateSeed(
    string calldata _seed,
    bytes memory _signature
  ) external view {
    bytes32 digest = _hashTypedDataV4(keccak256(abi.encode(
        keccak256("UpgradeItem(address user,string seed,uint256 nonce)"),
        msg.sender,
        keccak256(bytes(_seed)),
        0
      )));
    address signer = ECDSAUpgradeable.recover(digest, _signature);
    require(signer == admin, "MessageVerifier: invalid signature");
    require(signer != address(0), "ECDSAUpgradeable: invalid signature");
  }
}
